import React from "react";
import '../stylesX/ContactUs.css';
import {FontAwesomeIcon} from '@fortawesome/react-fontawesome';
import {faLocationDot, faPhone, faEnvelope} from '@fortawesome/free-solid-svg-icons';

function ContactUs() {
    return(
        <>
        <h1 id='title'>Contact Us</h1>
        <div id='bodyBox'>
            Do you have any questions for us? Please don't hesitate to contact us! Our team will respond within a matter of hours to assist you.
            
            <form id='contactUs'>
                <input type='text' id='firstName' placeholder="First Name"/>
                <input type='text' id='lastName' placeholder="Last Name"/>
            </form>
        </div>

        <div id='contactInfo'>
            <FontAwesomeIcon icon={faLocationDot}/>&nbsp;&nbsp;&nbsp;&nbsp;San Francisco, CA 94126, USA
            <br/><br/>
            <FontAwesomeIcon icon={faPhone}/>&nbsp;&nbsp;&nbsp;&nbsp;+ 01 234 567 89
            <br/><br/>
            <FontAwesomeIcon icon={faEnvelope}/>&nbsp;&nbsp;&nbsp;&nbsp;contact@mdbootstrap.com
        </div>
        </>
    )
}

export default ContactUs;
